#
# TABLE STRUCTURE FOR: vw_barang
#

DROP TABLE IF EXISTS vw_barang;

CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `vw_barang` AS select `tbl_barang`.`id_barang` AS `id_barang`,`tbl_kategori`.`id_kategori` AS `id_kategori`,`tbl_kategori`.`kategori` AS `kategori`,`tbl_barang`.`nama` AS `nama`,`tbl_barang`.`satuan` AS `satuan` from (`tbl_barang` join `tbl_kategori` on((`tbl_kategori`.`id_kategori` = `tbl_barang`.`id_kategori`)));

utf8_general_ci;



#
# TABLE STRUCTURE FOR: vw_bbm
#

DROP TABLE IF EXISTS vw_bbm;

CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `vw_bbm` AS select `tbl_bbm`.`id_bbm` AS `id_bbm`,`tbl_bbm`.`no_mobil` AS `no_mobil`,`tbl_bbm`.`hari` AS `hari`,`tbl_bbm`.`tanggal` AS `tanggal`,`tbl_bbm`.`tujuan` AS `tujuan`,`tbl_bbm`.`acara` AS `acara`,`tbl_bbm`.`jumlah_liter` AS `jumlah_liter`,`tbl_bbm`.`id_spbu` AS `id_spbu`,`tbl_spbu`.`kode_spbu` AS `kode_spbu`,`tbl_spbu`.`nama_spbu` AS `nama_spbu`,`tbl_bbm`.`id_bidang` AS `id_bidang`,`tbl_bbm`.`nip` AS `nip`,`tbl_pegawai`.`nama` AS `nama`,`tbl_bidang`.`bidang` AS `bidang` from (((`tbl_bbm` join `tbl_bidang` on((`tbl_bbm`.`id_bidang` = `tbl_bidang`.`id_bidang`))) join `tbl_pegawai` on((`tbl_bbm`.`nip` = `tbl_pegawai`.`nip`))) join `tbl_spbu` on((`tbl_bbm`.`id_spbu` = `tbl_spbu`.`id_spbu`)));

utf8_general_ci;



#
# TABLE STRUCTURE FOR: vw_file
#

DROP TABLE IF EXISTS vw_file;

CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `vw_file` AS select `tbl_file`.`id_file` AS `id_file`,`tbl_pegawai`.`nip` AS `nip`,`tbl_pegawai`.`nama` AS `nama`,`tbl_file`.`jenis` AS `jenis`,`tbl_file`.`keterangan` AS `keterangan`,`tbl_file`.`nama_file` AS `nama_file` from (`tbl_pegawai` join `tbl_file` on((`tbl_file`.`nip` = `tbl_pegawai`.`nip`)));

utf8_general_ci;



#
# TABLE STRUCTURE FOR: vw_kapling
